Lylith just got an emergency call from the ZZ mansion. It looks like Keiran has been tied up by a thief. After taking care of the bandit, Lylith turns her attention to Mr. Lee. She'll do whatever it take to revive him. Her methods might be a bit unorthodox, but Keiran doesn't mind one bit.
